import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './styles.css';  // Add this line if you have a styles.css
import App from './App';
import { CartProvider } from './CartContext';

ReactDOM.render(
  <CartProvider>
    <App />
  </CartProvider>,
  document.getElementById('root')
);
